import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Ropa",       amount: 19800, date: new Date(2022, 8, 28) },
    { title: "Super",      amount: 2500, date: new Date(2021, 8, 29) },
    { title: "Transporte", amount: 400, date: new Date(2021, 8, 28) },
    { title: "Caramelos",  amount: 500, date: new Date(2021, 8, 28) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
